import React, { useState, useEffect } from 'react';
import { useLocation, useNavigate } from 'react-router-dom';

function MusicPlayerPage() {
  const location = useLocation();
  const navigate = useNavigate();
  const { moods } = location.state || {};
  const [playlists, setPlaylists] = useState([]);
  const [currentTrack, setCurrentTrack] = useState(null);
  const [isPlaying, setIsPlaying] = useState(false);
  const [note, setNote] = useState('');

  useEffect(() => {
    if (!moods) {
      navigate('/mood');
      return;
    }

    const moodNames = Object.keys(moods);
    const mockPlaylists = [
      {
        id: 1,
        title: `Музыка для ${moodNames[0] || 'настроения'}`,
        tracks: ['Трек 1', 'Трек 2', 'Трек 3']
      },
      {
        id: 2,
        title: 'Рекомендации Яндекс.Музыки',
        tracks: ['Популярный трек', 'Хит дня', 'Новинка']
      },
      {
        id: 3,
        title: 'Персональная подборка',
        tracks: ['Любимая песня', 'Ретро хит', 'Инди трек']
      }
    ];
    setPlaylists(mockPlaylists);
  }, [moods, navigate]);

  const playTrack = (playlist, trackIndex) => {
    setCurrentTrack({
      playlist: playlist.title,
      track: playlist.tracks[trackIndex]
    });
    setIsPlaying(true);
  };

  const togglePlayback = () => {
    setIsPlaying(!isPlaying);
  };

  const saveToDiary = () => {
    if (!currentTrack) {
      alert('Выберите трек для сохранения');
      return;
    }

    const entry = {
      date: new Date().toISOString(),
      moods,
      music: currentTrack,
      note
    };

    // Сохраняем в localStorage для демонстрации
    const entries = JSON.parse(localStorage.getItem('diaryEntries') || '[]');
    entries.unshift({ id: Date.now(), ...entry });
    localStorage.setItem('diaryEntries', JSON.stringify(entries));

    alert('Запись сохранена в дневник!');
    navigate('/diary');
  };

  if (!moods) return null;

  return (
    <div className="container">
      <div className="header">
        <h2 style={{ color: 'white', marginBottom: '20px' }}>Музыка для вашего настроения</h2>
      </div>

      {playlists.map(playlist => (
        <div key={playlist.id} className="playlist-card">
          <div className="playlist-cover">{playlist.id}</div>
          <h3 style={{ textAlign: 'center', marginBottom: '15px' }}>{playlist.title}</h3>
          <div>
            {playlist.tracks.map((track, index) => (
              <div
                key={index}
                className="track-item"
                onClick={() => playTrack(playlist, index)}
              >
                <span style={{ marginRight: '10px' }}>▶️</span>
                <span>{track}</span>
              </div>
            ))}
          </div>
        </div>
      ))}

      {currentTrack && (
        <div className="player-container">
          <h3 style={{ marginBottom: '15px' }}>Сейчас играет</h3>
          <div className="current-track">
            <div className="track-cover"></div>
            <div className="track-info">
              <div style={{ fontWeight: 'bold' }}>{currentTrack.track}</div>
              <div style={{ color: '#666', fontSize: '14px' }}>{currentTrack.playlist}</div>
            </div>
            <button className="play-btn" onClick={togglePlayback}>
              {isPlaying ? '⏸️' : '▶️'}
            </button>
          </div>
        </div>
      )}

      <div className="card">
        <h3 style={{ marginBottom: '10px' }}>Добавить заметку:</h3>
        <textarea
          className="input"
          placeholder="Что вы чувствуете сейчас?"
          value={note}
          onChange={(e) => setNote(e.target.value)}
          rows="3"
          style={{ resize: 'vertical', minHeight: '80px' }}
        />
      </div>

      <button className="btn btn-primary" onClick={saveToDiary}>
        Сохранить в дневник
      </button>

      <button 
        className="btn btn-secondary" 
        onClick={() => navigate('/diary')}
        style={{ marginTop: '10px' }}
      >
        Открыть дневник
      </button>
    </div>
  );
}

export default MusicPlayerPage;
